import React from 'react';
import styled from 'styled-components';

function SliderItem(props) {
	return (
		<Wrapper>
			<img height='600px' width='1000px' src={props.image} alt=''></img>
		</Wrapper>
	);
}

export default SliderItem;

const Wrapper = styled.div`
	width: 100vw;
	overflow: hidden;
	height: 600px;
`;
